var closeorglist = true;function getHttpRequest() {
   var xmlhttp = null;
     if (window.XMLHttpRequest) {
       xmlhttp = new XMLHttpRequest();
    }
    else if (window.ActiveXObject) {
        xmlhttp = new ActiveXObject("Microsoft.XMLHTTP");
    }
    xmlhttp.open("GET", ('Overview?string='+document.getElementById('org').value.replace(/\s/g,'nbsp;')), true);
    xmlhttp.onreadystatechange = function() {
        if(xmlhttp.readyState == 4 && xmlhttp.status == 200) {
          var antwort = xmlhttp.responseText;
           if(antwort.length>1) { 
             document.getElementById('orglist').innerHTML = antwort;
             document.getElementById('vorschlag').style.display='inline';
             } else             document.getElementById('vorschlag').style.display='none';
        }
    }
    xmlhttp.send(null);
}
